import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default function Profile(props) {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [path1, setPath1] = useState([]);
    const [path2, setPath2] = useState([]);

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const response = await fetch(`http://localhost:5500/info?username=${props.user}`);
                if (!response.ok) {
                    throw new Error('Failed to fetch user data');
                }
                const data = await response.json();
                setName(data.name);
                setEmail(data.email);
                setPath1(data.path1 || []);
                setPath2(data.path2 || []);
            } catch (error) {
                console.error('Error fetching user data:', error);
            }
        };
        fetchUserData();
        document.body.style.backgroundColor = props.mode === "light" ? "#f7f7f7" : "#333";
    }, [props.user, props.mode]);

    const handleDelete = async () => {
        try {
            const response = await fetch(`http://localhost:5500/delete?username=${props.user}`, {
                method: "DELETE"
            })
            if (response.ok) {
                props.loggedout();
                console.log("Account Successfully Deleted");
            }
        }
        catch (error) {
            console.log("Error Deleting an Account", error);
        }
    }

    return (
        <div className="container mt-5">
            <div className="row justify-content-center">
                <div className="col-md-8">
                    <div className="card mb-3">
                        <div className="card-body" style={{ backgroundColor: props.mode === "light" ? "#f0f0f0" : "#444", color: props.mode === "light" ? "#333" : "#f0f0f0" }}>
                            <h5 className="card-title">{name.toUpperCase()}</h5>
                            <p className="card-text">Email: {email}</p>
                            <div className="d-flex justify-content-between align-items-center">
                                <button className='btn btn-dark' onClick={props.loggedout} style={{ backgroundColor: "#FFA07A", color: "#242424", borderColor: "white" }}>Log Out</button>
                                <button className='btn btn-dark' onClick={handleDelete} style={{ backgroundColor: "#FFA07A", color: "#242424", borderColor: "white" }}>Delete Account</button>
                            </div>
                        </div>
                    </div>

                    <div className="card mb-3">
                        <div className="card-body" style={{ backgroundColor: props.mode === "light" ? "#f0f0f0" : "#444", color: props.mode === "light" ? "#333" : "#f0f0f0" }}>
                            <h5 className="card-title">Profile Information</h5>
                            <ul className="list-group list-group-flush">
                                <li className="list-group-item" style={{ backgroundColor: props.mode === "light" ? "#f0f0f0" : "#444", color: props.mode === "light" ? "#333" : "#f0f0f0" }}><strong>Name:</strong> {name}</li>
                                <li className="list-group-item" style={{ backgroundColor: props.mode === "light" ? "#f0f0f0" : "#444", color: props.mode === "light" ? "#333" : "#f0f0f0" }}><strong>Email:</strong> {email}</li>
                            </ul>
                        </div>
                    </div>

                    <div className="card mb-3">
                        <div className="card-body" style={{ backgroundColor: props.mode === "light" ? "#f0f0f0" : "#444", color: props.mode === "light" ? "#333" : "#f0f0f0" }}>
                            <h5 className="card-title">StyleTransfer Activity</h5>
                            <div className="image-gallery d-flex flex-wrap justify-content-center">
                                {path1.map((path, index) => (
                                    <img key={index} src={`http://localhost:5500/${path}`} alt="" style={{ height: "200px", width: "200px", marginBottom: "10px", borderRadius: "10px", objectFit: "cover", marginRight: "10px" }} />
                                ))}
                            </div>
                        </div>
                    </div>

                    <div className="card mb-3">
                        <div className="card-body" style={{ backgroundColor: props.mode === "light" ? "#f0f0f0" : "#444", color: props.mode === "light" ? "#333" : "#f0f0f0" }}>
                            <h5 className="card-title">DeepDream Activity</h5>
                            <div className="image-gallery d-flex flex-wrap justify-content-center">
                                {path2.map((path, index) => (
                                    <img key={index} src={`http://localhost:5500/${path}`} alt="" style={{ height: "200px", width: "200px", marginBottom: "10px", borderRadius: "10px", objectFit: "cover", marginRight: "10px" }} />
                                ))}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
